Promotional info - &quot;Benny's uncle has a very important job: he guards the treasury of a very tiny -- but very rich -- neighboring country. Uncle Placid has his work cut out for him, with thieves of every stripe always plotting to break in and steal the money, but he never expected a thief to try and steal the machines that make the money! While traveling back home with Benny during a school break with the printing plates on board, it looks like super-strong Benny might be the only one able to fend off a daring raid!&quot;

This is the 1280px digital copy by Bean-Empire. An HD copy will also be forthcoming. Thanks to them for their efforts; please seed and enjoy! 

